    const myNewState = async () => {

        try {
            const response = await fetch('https://jsonplaceholder.typicode.com/users');
            const data = await response.json();
            update(data);
        }
        catch (error) {
            console.log(error);
        }
    }
    return (
        <noteContext.Provider value={currant} >
            {props.children}
        </noteContext.Provider>
    )
}
